
#  解码算法
def confirm_Seven_Pro_Ten_list(input_data):
    #
    f = open(input_data)
    data = f.read()
    data = data.replace('\n', '')
    f.close()  # 关闭文件
    # print(data)
    i = 0
    sumSep = 0

    # 将十进制转为7位二进制
    seq_Sev = []
    for x in range(0, 128):
        a = x
        a = bin(x)  # 将数据转化为二进制的函数
        a = a[2:]  # 从第三位开始取数据
        seq_Sev.append(a.zfill(7))
    #    print(seq_Sev[x])

    a = [0] * 128
    while i <= len(data):
        for t in range(128):
            if seq_Sev[t] == str(data[i + 10: i + 17]):
                a[t] = int(a[t]) + 1
        i = i + 17

    #  上面数据 生成七位的二进制数据和出现在数据集中的概率
    # 将生成的两位列表，按照概率的高的进行排序
    dictionary = list()
    for i in range(len(seq_Sev)):
        dictionary.append([int(seq_Sev[i]), int(a[i])])
    dictionary.sort(key=lambda x: x[1], reverse=True)
    # 读取含有约束的均衡码
    with open("01Blance.txt", "r") as file:
        data = file.readlines()
    # 将01均衡码纳入列表中
    data1 = list()
    for i in range(len(data)):
        if i % 2 != 0:
            data1.append(data[i][:10])
    for i in range(len(dictionary)):
        dictionary[i].append(data1[i])
    return dictionary


#  将DNA序列转为二进制数据
def confirm_dna_seq_value(input_data):
    if input_data == 'A':
        return '00'
    elif input_data == 'C':
        return '10'
    elif input_data == 'T':
        return '01'
    elif input_data == 'G':
        return '11'
    else:
        ValueError('please input correct value!')

# DNA转为二进制
def convert_dna_to_data_sequence(code):  # 11 01 11 01 11 10 00 01 00 10
    dna_seq = []
    str1 = ""
    for i in range(len(code)):
        a = code[i]
        value = confirm_dna_seq_value(a)
#        dna_seq.append(value)
        str1 = str1 + str(value)
    return str1


# 二进制数据转为十进制数据
#  传值是二进制数据，传出是十进制数据
def confirm_binary_tenbinary(Odd , Mate):
    Odd1 = 0
    Mate1 = 0
    dictionary_binary_ten = []
    for i in range(1024):
        dictionary_binary_ten.append([i , bin(i)[2 : ]])
    for i in range(1024):
        if int(Odd) == int(dictionary_binary_ten[i][1]):
            Odd1 =  dictionary_binary_ten[i][0]
        if int(Mate) == int(dictionary_binary_ten[i][1]):
            Mate1 =  dictionary_binary_ten[i][0]
    return Odd1, Mate1

#传递数据：将list DNA数据转传入，字典
#(1) 将数据转化为二进制数据
#(2) 将数据分割成十个一组
#(3) 进行异或
#(4) 组合成新的数据
#解码调用函数：  confirm_dna_seq_value       convert_data_to_dna_sequence
#输出是完整的数据   list类型

def decode_core_method(data,dictionary):
    DnaString_Maxgroup = []
    for t in range(len(data)):
        Odd = ""
        Mate = ""
        one_MaxGroup = ""

        test5 = data[t]
        DnaString_BitGroup = convert_dna_to_data_sequence(data[t])
#        DnaString_BitGroup = convert_dna_to_data_sequence(data)
        if 280 < len(DnaString_BitGroup) < 300:
            ##   没执行这一步
            DnaString_BitGroup.ljust(300, '0')
        if len(DnaString_BitGroup) > 300:
            DnaString_BitGroup = DnaString_BitGroup[0: 300]
        # 将数据分成奇偶两部分并进行分成小组
        for i in range(len(DnaString_BitGroup)):
            if i % 2 == 0:
                Odd = Odd + str(DnaString_BitGroup[i])
            else:
                Mate = Mate + str(DnaString_BitGroup[i])

        # 将数据分割成10个一小组，Mate_MinGroup     Odd_MinGroup(list   里面是String)
        Mate_MinGroup = []
        for i in range(0, len(Mate), 10):
            Mate1_MinGroup = Mate[i:i + 10]
            Mate_MinGroup.append(Mate1_MinGroup)
        Odd_MinGroup = []
        for i in range(0, len(Odd), 10):
            Odd1_MinGroup = Odd[i:i + 10]
            Odd_MinGroup.append(Odd1_MinGroup)

        # 进行异或    并且将十进制映射成七进制
#        Odd_MinGroup1 = 0
#        Mate_MinGroup1 = 0
        for i in range(len(Odd_MinGroup)):
            count = 0
            Odd_MinGroup1 , Mate_MinGroup1 = confirm_binary_tenbinary(int(Odd_MinGroup[i]) , int(Mate_MinGroup[i]))
            Mate_MinGroup[i] = str(Mate_MinGroup[i]).zfill(10)
            for j in range(len(dictionary)):
                if int(dictionary[j][2]) == int(Odd_MinGroup[i]):
                    Odd_MinGroup[i] = str(dictionary[j][0]).zfill(7)
                    count = 1
            if count == 0:
                Odd_MinGroup[i] = "1111111"

        # 将两组数据进行结合
        for i in range(len(Odd_MinGroup)):
            one_MaxGroup = one_MaxGroup + Mate_MinGroup[i] + Odd_MinGroup[i]
        # 将数据放到字典中
        DnaString_Maxgroup.append(one_MaxGroup)
    return DnaString_Maxgroup




